import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p> Fly At Will </p>
        <form>
          <label>名字:<input type="text" name="name" /></label>
          <input type="submit" value="提交" />
        </form>
      </header>
    </div>
  );
}


export default App;
